= WYSIWYG editing mode =

This mode is ideal for first time users or people who do not want to use the Wiki Syntax. It's a mode similar to the one used by your favorite word processor in which you see how what you type is rendered. There's a toolbar available to add special effects to your text, add images, insert links, add macros, etc.

{{image reference="Features.PageEditing@wysiwyg.png"/}}

{{velocity}}
{{html wiki="true"}}
#info("Starting with XWiki Enterprise 1.7 we now have 2 WYSIWYG editors and we are phasing out the old editor (based on TinyMCE) that you'll be automatically using if your documents are written in XWiki Syntax 1.0. If your [[document is using the XWiki Syntax 2.0>>#HChoosingaSyntax]] or if your wiki is [[configured to use the XWiki Syntax 2.0 by default>>platform:AdminGuide.Configuration#HConfiguringWikiSyntaxesanddefaultSyntax]] then you'll be using automatically the [[new WYSIWYG editor (based on GWT)>>WysiwygEditor]].")
{{/html}}
{{/velocity}}

Read the [[documentation for using the new WYSIWYG editor>>WysiwygEditor]] for more details.

= Setting the page parent =

In order to have an organized structure of your page, when you create a new page in a space, its parent will be automatically set to be the WebHome page of the space in which you create the page.

If you want to change the parent of the page, you have to edit the page with wiki or wysiwyg editors.

{{image reference="Features.PageEditing@documentParent.png"/}}

Click on the small pencil above the page title in order to edit the page parent.

{{image reference="Features.PageEditing@documentParentCollapsed.png"/}}

{{info}}
If the page has no parent set, the breadcrumbs feature will not show the path to navigate from the Main.WebHome to the page. These pages are called orphan pages.
{{/info}}

{{image reference="Features.PageEditing@documentParentNoParent.png"/}}

{{image reference="Features.PageEditing@pageNoBreadcrumb.png"/}}

{{warning}}
Please note that when you copy a page, its parent field will not be updated accordingly to the new space the copy is in. You will have to do that manually.
{{/warning}}

= Form editing mode (aka inline mode) =

Inline mode, or Form mode, is a special feature of XWiki, that allows administrators to define patterns of structured information (like a blog entry, or a standard tax form). Pages containing such structured information can be edited and re-edited as simple HTML Forms, which have (almost) the same structure as the displayed page. Thus, when clicking the edit button, it seems that the page content can be edited in-place, or inline and the form view is automatically displayed.

Technically the inline mode is triggered automatically differently whether the page is written in XWiki Syntax 1.0 or 2.0, using the following algorithm:

* XWiki Syntax 1.0: If the page contains a call to ###includeForm()##
* XWiki Syntax 2.0: If the page is including another page which itself contains an object of the type ##XWiki.SheetClass##

Note that it is beyond the scope of this simple guide to explain the programming technique supporting this feature. Please check the [[Developer's Guide>>DevGuide.WebHome]] to find out more about programming with Objects/Classes and Forms.

= Objects editing mode =

In XWiki it's possible to attach Objects to pages. Objects are simple sets of properties with values that add additional information about a page. For example a security right can be added to a page to control its rights, a blog object is attached to a page representing a blog entry, etc. Again, it's beyond this simple guide to explain this programming technique. Please check the [[Developer's Guide>>DevGuide.WebHome]] to know more about programming with Objects/Classes.

[[image:Features.PageEditing@ObjectEditor.png||style="border: 1px solid silver;"]]

= Classes editing mode =

We've seen that some pages can have Objects attached to them. Some pages can also be Object definitions, a.k.a Classes. The Classes editing mode calls the class editor on the current page, allowing to edit the Classes attached to the document. Again, it's beyond this simple guide to explain this programming technique. Please check the [[Developer's Guide>>DevGuide.WebHome]] to find out more about programming with Objects/Classes.
[[image:Features.PageEditing@ClassEditor.png||style="border: 1px solid silver;"]]

= Access Rights editing mode =

This mode allows you to control the access rights for the page you're viewing (you need to have the required access rights to modify a page's rights). See the [[Rights Management>>Features.RightsManagement]] topic for more information.

= Full Screen Mode =

From version 1.1 onwards, a full-screen mode is available in XWiki. When editing a page either in Wiki or WYSIWYG mode, clicking on the green button at the top right of the edit box will send the editor in full-screen mode. You can then edit your page as usual and click on the green button to return to the usual interface when you are finished.

