= Title Behavior =

Pages have both names and titles. The page name is used in the URL to the page while the title is used to display a user-friendly short description of the page. The title is used for example as the top level headings when viewing a page.

Page titles can be set while editing documents in Wiki or WYSIWYG modes.

Titles are not mandatory by default but it's possible to [[configure XWiki to make titles mandatory>>platform:AdminGuide.Configuration#HTitlebehavior]].

When a page has no title set then XWiki tries to compute it by extracting the topmost heading from the document's content. For example if you have a level 1 heading, it'll be used as the page title. If you don't have a level 1 heading but have a level 2 heading then the level 2 heading will be used as the page title. The heading level depth XWiki used for titles is controlled in [[XWiki's title configuration>>platform:AdminGuide.Configuration#HTitlebehavior]]. If no heading is found or if the topmost heading has a level below the configured level then the page name is used as the title.

Currently title content is parsed using Velocity so you're allowed to put Velocity content in there (this is for example useful when wanting to internationalize titles). Since you're allowed to use any wiki syntax in headings, if a page doesn't have a title set (and titles are not mandatory) then any wiki markup in the topmost headings will beget rendered when displaying the extracted title for that page.
